import React, { useState, useEffect } from 'react'

function App() {
  
   const [data, setData] = useState([{}])

   useEffect(()=>{
         fetch("/homepage").then(
            res => res.json()
         ).then(
               data => {
                  setData(data)
                  console.log(data)
               }
         )
      }, [])

    return (
    <div>
            {(typeof data.title ==='undefined') ? (
               <h1>Undefined</h1>
            ):(
                  data.title.map((title,i) => (
                     <h1 key ={0}>{title}</h1>
                     ))
                     )}
    </div>
  )
}

export default App
